import React, { useState } from 'react'
import { Link } from 'react-router-dom';

function Bookzone() {
    const [hoveredHome, setHoveredHome] = useState(false)

    const handleHoverHome = () => {
        setHoveredHome(!hoveredHome)
    }

    return (
        <div className='allpages projects-div project'>
            <Link to='/'><h2 onMouseEnter={handleHoverHome} onMouseLeave={handleHoverHome} className='home-button'>
                {hoveredHome ? 'home' : 'rui'}
            </h2></Link>
            <p>
                A copy of Tesla's website - to further improve my frontend development skills.
                <br /><br />
                made with
                <br />
                HTML, CSS, ExpressJS and MongoDB
                <br /><br /><br /><br />
                Website:
                <br />
                <Link to='https://bookzone.adaptable.app/' target='_blank'><span className='links-to-websites'>https://bookzone.adaptable.app/</span></Link>
                <br />
                Github:
                <br />
                <Link to='https://github.com/RuiMSMelo/bookzone' target='_blank'><span className='links-to-websites'>https://github.com/RuiMSMelo/bookzone</span></Link>
            </p>
        </div>
    );
}

export default Bookzone;
